import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from 'react';
import { Jumbotron, Container, Button } from 'reactstrap';
import Head from 'next/head';
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fas } from '@fortawesome/free-solid-svg-icons';
import axios from 'axios';
import Menu from '../components/Menu';

library.add(fas);

const Home = (data) => (
    <div>
        <Head>
            <title>Home Page</title>
            <meta name="description" content="Site de ... sobre ..." />
            <meta name="author" content="Leo Buck" />
            <link rel="shortcut icon" href="/favicon.ico" />
        </Head>
        <Menu />
        <Jumbotron fluid className="descr-top">
            <style>{`.descr-top {
                background-color: #000;
                color: #FFF;
                padding-top: 150px;
                padding-bottom: 100px;
                margin-bottom: 0rem !important;
                position: relative;
            }
            .inicio-link {
                position: absolute;
                top: 0px;
            }`}</style>
            <Container className="text-center">
                <a name="inicio" className="inicio-link"></a>
                <h1 className="display-4 mb-4">Temos a solução que sua empresa precisa!</h1>
                <p className="lead mb-4">Solicite uma demonstração</p>
                <Button outline color="warning" size="lg">Entre em contato</Button>
            </Container>
        </Jumbotron>
        <Jumbotron fluid className="servicos">
            <style>{`.servicos {
                background-color: #FFF;
                padding-top: 80px;
                padding-bottom: 80px;
                margin-bottom: 0rem !important;
                position: relative;
            }
            .servicos-link {
                position: absolute;
                top: 0px;
            }
            .circulo {
                width: 140px;
                height: 140px;
                background-color: #fed136;
                font-size: 52px;
                padding-top: 24px;
                color: #FFF;
            }
            .centralizar {
                margin: 0 auto !important;
                float: none !important;
            }`}</style>
            <Container className="text-center">
                <a name="servicos" className="servicos-link"></a>
                <div>
                    <h2 className="display-4">Serviços</h2>
                    <p className="lead pb-4">Serviços oferecido pela nossa empresa</p>
                </div>
                <div className="row">
                    <div className="col-lg-4">
                        <div className="rounded-circle circulo centralizar">
                            <FontAwesomeIcon icon="code" />
                        </div>
                        <h2 className="mt-4 mb-4">Consultoria</h2>
                        <p>Consultoria</p>
                        <p><a className="btn btn-secondary" href="/">Saiba mais</a></p>
                    </div>
                    <div className="col-lg-4">
                        <div className="rounded-circle circulo centralizar">
                            <FontAwesomeIcon icon="laptop-code" />
                        </div>
                        <h2 className="mt-4 mb-4">Consultoria</h2>
